import { useState } from "react";
import CartPopup from "./CartPopup";

const filterCars = (setSelectedCategory, setSelectedSubCategory, setCars) => {
    const result = setCars.filter((cars)=>{
        return cars.category = setSelectedCategory && cars.seats===setSelectedSubCategory; 
    })
    setCars(result);
};

export default filterCars;
